import React, { useEffect, useState } from "react";
import axios from "axios";
import { useParams } from "react-router-dom";

function AgentLists({ token }) {
  const { id } = useParams();
  const [lists, setLists] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");

  useEffect(() => {
    const fetchLists = async () => {
      try {
        const res = await axios.get(
          `http://localhost:5000/api/csv/agent/${id}`,
          { headers: { Authorization: `Bearer ${token}` } }
        );
        setLists(res.data);
        setLoading(false);
      } catch (err) {
        setError(err.response?.data?.message || "Failed to fetch lists");
        setLoading(false);
      }
    };
    fetchLists();
  }, [id, token]);

  if (loading) return <p style={{ textAlign: "center" }}>Loading...</p>;
  if (error) return <p className="error">{error}</p>;

  return (
    <div className="container">
      <h2>Distributed Lists for Agent</h2>
      {lists.length === 0 ? (
        <p>No items assigned yet.</p>
      ) : (
        <table>
          <thead>
            <tr>
              <th>#</th>
              <th>First Name</th>
              <th>Phone</th>
              <th>Notes</th>
            </tr>
          </thead>
          <tbody>
            {lists.map((item, index) => (
              <tr key={index}>
                <td>{index + 1}</td>
                <td>{item.FirstName}</td>
                <td>{item.Phone}</td>
                <td>{item.Notes}</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
}

export default AgentLists;
